import React, { useState } from 'react';
import './App.css';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,InputGroup, InputGroupAddon, InputGroupText, Input
} from 'reactstrap';

const Navig = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);
  var logo = {
    width: "150px"
  };
  var nav = {
    backgroundColor: "#282c34"
  }
  return (
    <div>
      <Navbar style={nav} expand="md">
        <NavbarBrand href="/"><img src="/rockarocket-logo.png" style={logo}/></NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="mr-auto" navbar>
          </Nav>
          <NavLink href="https://github.com/reactstrap/reactstrap">Log In</NavLink>
        </Collapse>
      </Navbar>
    </div>
  );
}

function App() {
  var white = {
    color: "white"
  }
  return (
    <div>
      <Navig/>
      <div className="background d-flex justify-content-center align-items-center">
        <ROW>
        <h1 className="display-3" style={white}>FIND A TRIP</h1>
        </ROW>
        <InputGroup>
        <InputGroupAddon addonType="prepend">
          <InputGroupText>@</InputGroupText>
        </InputGroupAddon>
        <Input placeholder="username" />
      </InputGroup>
      </div>
    </div>
  );
}

export default App;
